import React from 'react'
const PriceCard = () => {
    return ( 
    <div className="w3-center">
        <b>Logical Genius</b>
        <p>Unlock now</p>
        <button
                type="button"
                className="w3-button w3-round-xxlarge w3-text-white"
                style={{
                  backgroundColor: 'orange', marginLeft: '1.5em',
                }}
              >
                <b>Rs.199</b>
              </button>
    </div> );
}

export default PriceCard;
